void _itineraryItemSerialize(
  ItineraryItem object,
  IsarWriter writer,
  List<int> offsets,
  Map<Type, List<int>> allOffsets,
) {
  writer.writeString(offsets[0], object.activity);
  writer.writeDouble(offsets[1], object.lat);
  writer.writeDouble(offsets[2], object.lng);
  writer.writeString(offsets[3], object.time);
}

ItineraryItem _itineraryItemDeserialize(
  Id id,
  IsarReader reader,
  List<int> offsets,
  Map<Type, List<int>> allOffsets,
) {
  final object = ItineraryItem();
  object.activity = reader.readString(offsets[0]);
  object.lat = reader.readDouble(offsets[1]);
  object.lng = reader.readDouble(offsets[2]);
  object.time = reader.readString(offsets[3]);
  return object;
}

P _itineraryItemDeserializeProp<P>(
  IsarReader reader,
  int propertyId,
  int offset,
  Map<Type, List<int>> allOffsets,
) {
  switch (propertyId) {
    case 0:
      return (reader.readString(offset)) as P;
    case 1:
      return (reader.readDouble(offset)) as P;
    case 2:
      return (reader.readDouble(offset)) as P;
    case 3:
      return (reader.readString(offset)) as P;
    default:
      throw IsarError('Unknown property with id $propertyId');
  }
}

